  false,\n\t\"url\": null,\n\t\"notes\": \"The Family Planning Benefit Program (FPBP)
  is a free and completely confidential New York State program that provides family
  planning services to teens, women and men who meet certain income and residency
  requirements, and who are not enrolled in Medicaid or Family Health Plus. You may
  obtain coverage through FPBP if you meet certain Eligibility Criteria and your income
  is equal to or less than the income levels listed here. This chart is only a guide.
  Individuals should see an enrollment counselor for eligibility screening.u00a0   n*
  Pregnant Women count as two individuals.nNOTE: Chart effective January 1, 2012;
  subject to annual income updates.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
